import React from "react";
import { ReactDOM } from "react";

const Navbar = () => {
  return (
    <nav>
      <div className="nav_box">
        <span className="hortifruti">Hortifruti</span>
        <div className="carrinho">
          <span></span>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
